import React from "react";

const Head = () => {
  return (
    <div>
      <div>
      <img
        src="https://www.svgrepo.com/show/312300/hamburger-menu.svg"
        alt="menu"
      />
      <img src="data:image/png;base64," alt="logo" />
      </div>
      <div>
        <input type="text" />
        <button>Search</button>
      </div>
      <div>
        <img src="data:image/png;base64," alt="user-icon" />
      </div>
    </div>
  );
};

export default Head;
